Les confidences : 🌸
-
Voilà bien un des points indispensables qui permet le rapprochement. Il est difficile d’imaginer deux personnes capables de ne passer que des bons moments ensemble ou de ne s’échanger que des banalités.
-
 Cela arrive parfois dans les amitiés, pourtant il est préférable de pouvoir tout partager de soi quand on a trouvé l’homme/la femme de notre vie, les bonnes choses comme les mauvaises.
-
Après l’étape du feeling, vient celle des confidences. Cela arrive lorsqu’on se sent suffisamment proche de l’autre, en sécurité pour pouvoir s’ouvrir. 
-
Se confier renforce la relation, car c’est lorsque nous sommes exposés à la vulnérabilité que nous sommes davantage en mesure d’apprécier et d’aimer l’autre. Comme les secrets qu’on peut se raconter quand nous sommes enfants, nous avons l’impression de détenir quelque chose de précieux et qu’il s’agit là d’une grande marque de considération.
