-
23h30.
Le stress monte. Nous rentrons de notre soirée, qui n'est pas terminée... Je me demande à quoi va ressembler cette mise en scène. Ça allait autant être pour elle que pour moi une surprise ! Même si j'étais à l'origine de cette demande en mariage, je n'avais que mon imagination pour voir le résultat final. Nous sortons de la voiture pour aller à notre chambre. Le temps est d'une douceur incroyable pour la saison. Nous voyons au loin une légère lumière. Plus nous avançons, plus elle se précise. 
La magie opère. E., intriguée, s'approche, sans se douter une seconde de ce qu'il se passait. 

Elle passe le bassin éclairé de toutes ces bougies. Je l'accompagne. Et l'invite à me rejoindre au centre de la lumière sous cette superbe verdure. Elle ne comprend pas. Ou elle se refuse d'y croire peut-être? Et. Elle aperçoit. Sur la table. Parmi tout ce spectacle, les compositions florales, les cloches en verre avec la barbe à papa, les pâtisseries... Une boîte. La suite n'est pas réfléchie. Je m'étais dis que je me laisserai guider par l'émotion qui prendrait sûrement le dessus à cet instant. Ce fut le cas. 

